--
-- Table structure for table `js_sys_dict_data`
--

DROP TABLE IF EXISTS `js_sys_dict_data`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `js_sys_dict_data` (
  `dict_code` varchar(64) COLLATE utf8_unicode_ci NOT NULL COMMENT '字典编码',
  `parent_code` varchar(64) COLLATE utf8_unicode_ci NOT NULL COMMENT '父级编号',
  `parent_codes` varchar(1000) COLLATE utf8_unicode_ci NOT NULL COMMENT '所有父级编号',
  `tree_sort` decimal(10,0) NOT NULL COMMENT '本级排序号（升序）',
  `tree_sorts` varchar(1000) COLLATE utf8_unicode_ci NOT NULL COMMENT '所有级别排序号',
  `tree_leaf` char(1) COLLATE utf8_unicode_ci NOT NULL COMMENT '是否最末级',
  `tree_level` decimal(4,0) NOT NULL COMMENT '层次级别',
  `tree_names` varchar(1000) COLLATE utf8_unicode_ci NOT NULL COMMENT '全节点名',
  `dict_label` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '字典标签',
  `dict_value` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '字典键值',
  `dict_type` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '字典类型',
  `is_sys` char(1) COLLATE utf8_unicode_ci NOT NULL COMMENT '系统内置（1是 0否）',
  `description` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '字典描述',
  `css_style` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'css样式（如：color:red)',
  `css_class` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'css类名（如：red）',
  `status` char(1) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0' COMMENT '状态（0正常 1删除 2停用）',
  `create_by` varchar(64) COLLATE utf8_unicode_ci NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) COLLATE utf8_unicode_ci NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注信息',
  `corp_code` varchar(64) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0' COMMENT '租户代码',
  `corp_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'JeeSite' COMMENT '租户名称',
  `extend_s1` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展 String 1',
  `extend_s2` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展 String 2',
  `extend_s3` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展 String 3',
  `extend_s4` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展 String 4',
  `extend_s5` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展 String 5',
  `extend_s6` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展 String 6',
  `extend_s7` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展 String 7',
  `extend_s8` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展 String 8',
  `extend_i1` decimal(19,0) DEFAULT NULL COMMENT '扩展 Integer 1',
  `extend_i2` decimal(19,0) DEFAULT NULL COMMENT '扩展 Integer 2',
  `extend_i3` decimal(19,0) DEFAULT NULL COMMENT '扩展 Integer 3',
  `extend_i4` decimal(19,0) DEFAULT NULL COMMENT '扩展 Integer 4',
  `extend_f1` decimal(19,4) DEFAULT NULL COMMENT '扩展 Float 1',
  `extend_f2` decimal(19,4) DEFAULT NULL COMMENT '扩展 Float 2',
  `extend_f3` decimal(19,4) DEFAULT NULL COMMENT '扩展 Float 3',
  `extend_f4` decimal(19,4) DEFAULT NULL COMMENT '扩展 Float 4',
  `extend_d1` datetime DEFAULT NULL COMMENT '扩展 Date 1',
  `extend_d2` datetime DEFAULT NULL COMMENT '扩展 Date 2',
  `extend_d3` datetime DEFAULT NULL COMMENT '扩展 Date 3',
  `extend_d4` datetime DEFAULT NULL COMMENT '扩展 Date 4',
  PRIMARY KEY (`dict_code`),
  KEY `idx_sys_dict_data_cc` (`corp_code`),
  KEY `idx_sys_dict_data_dt` (`dict_type`),
  KEY `idx_sys_dict_data_pc` (`parent_code`),
  KEY `idx_sys_dict_data_status` (`status`),
  KEY `idx_sys_dict_data_pcs` (`parent_codes`(255)),
  KEY `idx_sys_dict_data_ts` (`tree_sort`),
  KEY `idx_sys_dict_data_tss` (`tree_sorts`(255)),
  KEY `idx_sys_dict_data_dv` (`dict_value`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='字典数据表';
/*!40101 SET character_set_client = @saved_cs_client */;

