DROP TABLE IF EXISTS `js_sys_dict_type`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `js_sys_dict_type` (
  `id` varchar(64) COLLATE utf8_unicode_ci NOT NULL COMMENT '编号',
  `dict_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '字典名称',
  `dict_type` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '字典类型',
  `is_sys` char(1) COLLATE utf8_unicode_ci NOT NULL COMMENT '是否系统字典',
  `status` char(1) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0' COMMENT '状态（0正常 1删除 2停用）',
  `create_by` varchar(64) COLLATE utf8_unicode_ci NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) COLLATE utf8_unicode_ci NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注信息',
  PRIMARY KEY (`id`),
  KEY `idx_sys_dict_type_is` (`is_sys`),
  KEY `idx_sys_dict_type_status` (`status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='字典类型表';
